e world through what I know from science, experience, reflection, etc. Belief systems are also connected to language.\u000b\nDivorced; no kids\u000bThe divorce was in 2017. The marriage was practical and beneficial to both of us. But we were also in love - so not just a practical arrangement either. \n\nDon’t smoke (prefer that you don\u0027t, or you\u0027re trying to quit). Rarely drink (don’t mind if you do).\n\nPhotos\n\n\u0010\u0012\u001c*\n\u001c*\n\u0012\u001c*\n*\n\u001c\n\n\n\n*\n\u0011\n\nHow I spend my time\n\nFor work (as defined in the conventional sense), I do machine learning in tech.\u000b\nMy background is actually in applied math, which I love. I enjoy using my quantitative skills at work. But I value things outside of work a lot, in terms of how I interact with and contribute to society.\n\u000bI really value expression in life, whether it’s through the written word or through movement. Some of my interests:\n\nDance: It’s been a non-trivial part of my life for at least a decade now. I’ve always been moved by music (although I didn’t have the chance to learn music/dance formally growing up). And being able to express music is what I love the most about dance.\u000b\nMovement practice like yoga, fitness classes and aerial hoop (this is my latest obsession as of a year ago - I always try to have some things that are hard for me to keep me humble and motivated to grow, and some things where I can feel good about myself).\u000b\nWritten words: I love to read (when I can these days) and write creatively. Within fiction, I love any flavor of existentialism.\n\nTennis. Really any racquet sport: ping pong, badminton, pickleball (I gave in)\u000b\nCooking: I cook for myself and love what I make for myself more than any restaurant food.\n\nTravel: I’ve traveled a lot, both solo and with partners. There’s a wide variety of things that interest me: foreign cultures, nature, road trips.\n\nVolunteering: a bunch of different things from children’s health and education to homelessness and food security. \nRelationship stuff\nThings I value\n(both in others and about myself)\n\nEmpathy: I just want to be around people who care about others. I’m empathetic and it’s so easy for me to care about my partner in long term relationships. It’s nice when we can look out for each other in our own ways and our strengths can be complementary. Two people thinking for both!\n\nAuthenticity/sincerity: I just like being myself and I appreciate people who can just share time with me and maybe we see through each other a bit during the time we interact. It’s what I enjoy in any kind of connection, even non-romantic ones.\n\nOpen-minded: I mean in the sense of questioning your own assumptions about life. I’m curious about the deep stuff in life and am very aware that all of my beliefs are also connected to my personal experience and that a new experience or a new rational argument has the potential to change that belief. I may have a high confidence about some of my beliefs based on what I’ve experienced, but I’m always open to learning a different perspective even it that doesn’t make sense to me at that time.\u000b\nCommunication: I think it really goes both ways. This is the mental model that I want to keep in mind for myself:\nAs a speaker, I try to express my needs trying my best not to hurt my partner.\nAs a listener, I have to be ready to hear the hard stuff without taking it as a judgement about myself.\nBoth are hard and I know I’ll fail a lot. But it’s a kindness practice the same way I work on exercising my body. In the end, everything is negotiable.\nDating style\n\u000bIf we decide we might be a match, I\u0027d prefer to do a brief video chat or a quick coffee date sooner rather than messaging back and forth. I\u0027m sure you\u0027re great, but until I know you, I like to prioritize my little free time for my hobbies and with my real life communities. I’m happy to answer anything specific that’s missing here before we connect further.\n"},{"ty":"as","st":"document","si":0,"ei":0,"sm":{"ds_lhs":1,"ds_df":{"df_dm":1},"ds_ulhfl":false}},{"ty":"ae","et":"list","id":"kix.6baun97m88zl","epm":{"le_nb":{"nl_4":{"b_gf":"%4","b_ts":{"ts_un":false,"ts_un_i":false,"ts_sc":false,"ts_it_i":true,"ts_fgc2":{"hclr_color":"#000000","clr_type":0},"ts_st_i":true,"ts_bgc2":{"hclr_color":null,"clr_type":0},"ts_fs_i":true,"ts_ff_i":true,"ts_bgc2_i":true,"ts_it":false,"ts_va":"nor","ts_bd_i":true,"ts_va_i":true,"ts_fs":11.0,"ts_ff":"Arial","ts_st":false,"ts_bd":false,"ts_fgc2_i":true,"ts_sc_i":true,"ts_tw":400},"b_ifl":162.0,"b_gs":"-","b_a":0,"b_sn":1,"b_gt":9,"b_il":180.0},"nl_3":{"b_gf":"%3","b_ts":{"ts_un":false,"ts_un_i":false,"ts_sc":false,"ts_it_i":true,"ts_fgc2":{"hclr_color":"#000000","clr_type":0},"ts_st_i":true,"ts_bgc2":{"hclr_color":null,"clr_type":0},"ts_fs_i":true,"ts_ff_i":true,"ts_bgc2_i":true,"ts_it":false,"ts_va":"nor","ts_bd_i":true,"ts_va_i":true,"ts_fs":11.0,"ts_ff":"Arial","ts_st":false,"ts_bd":false,"ts_fgc2_i":true,"ts_sc_i":true,"ts_tw":400},"b_ifl":126.0,"b_gs":"-","b_a":0,"b_sn":1,"b_gt":9,"b_il":144.0},"nl_2":{"b_gf":"%2","b_ts":{"ts_un":false,"ts_un_i":false,"ts_sc":false,"ts_it_i":true,"ts_fgc2":{"hclr_color":"#000000","clr_type":0},"ts_st_i":true,"ts_bgc2":{"hclr_color":null,"clr_type":0},"ts_fs_i":true,"ts_ff_i":true,"ts_bgc2_i":true,"ts_it":false,"ts_va":"nor","ts_bd_i":true,"ts_va_i":true,"ts_fs":11.0,"ts_ff":"Arial","ts_st":false,"ts_bd":false,"ts_fgc2_i":true,"ts_sc_i":true,"ts_tw":400},"b_ifl":90.0,"b_gs":"-","b_a":0,"b_sn":1,"b_gt":9,"b_il":108.0},"nl_1":{"b_gf":"%1","b_ts":{"ts_un":false,"ts_un_i":false,"ts_sc":false,"ts_it_i":true,"ts_fgc2":{"hclr_color":"#000000","clr_type":0},"ts_st_i":true,"ts_bgc2":{"hclr_color":null,"clr_type":0},"ts_fs_i":true,"ts_ff_i":true,"ts_bgc2_i":true,"ts_it":false,"ts_va":"nor","ts_bd_i":true,"ts_va_i":true,"ts_fs":11.0,"ts_ff":"Arial","ts_st":false,"ts_bd":false,"ts_fgc2_i":true,"ts_sc_i":true,"ts_tw":400},"b_ifl":54.0,"b_gs":"-","b_a":0,"b_s  world. I think it’s a responsibility that you decide to take on as a couple very consciously when the relationship is in that place.\nHow to reach me?\nWrite to me \nif you think we might be a good match, or\nif something about my profile resonated with you and you’d like to talk about it even if you don’t think we’re a good match.\n\nEmail: karthikeyan.rajendran@gmail.com\nText: 609 613 2710"},{"ty":"ae","et":"list","id":"kix.ba2jg1b3oe27","epm":{"le_nb":{"nl_4":{"b_gf":"%4.","b_ts":{"ts_un":false,"ts_un_i":false,"ts_sc":false,"ts_it_i":true,"ts_fgc2":{"hclr_color":"#000000","clr_type":0},"ts_st_i":true,"ts_bgc2":{"hclr_color":null,"clr_type":0},"ts_fs_i":true,"ts_ff_i":true,"ts_bgc2_i":true,"ts_it":false,"ts_va":"nor","ts_bd_i":true,"ts_va_i":true,"ts_fs":11.0,"ts_ff":"Arial","ts_st":false,"ts_bd":false,"ts_fgc2_i":true,"ts_sc_i":true,"ts_tw":400},"b_ifl":198.0,"b_gs":"","b_a":0,"b_sn":1,"b_gt":13,"b_il":216.0},"nl_3":{"b_gf":"%3.","b_ts":{"ts_un":false,"ts_un_i":false,"ts_sc":false,"ts_it_i":true,"ts_fgc2":{"hclr_color":"#000000","clr_type":0},"ts_st_i":true,"ts_bgc2":{"hclr_color":null,"clr_type":0},"ts_fs_i":true,"ts_ff_i":true,"ts_bgc2_i":true,"ts_it":false,"ts_va":"nor","ts_bd_i":true,"ts_va_i":true,"ts_fs":11.0,"ts_ff":"Arial","ts_st":false,"ts_bd":false,"ts_fgc2_i":true,"ts_sc_i":true,"ts_tw":400},"b_ifl":162.0,"b_gs":"","b_a":0,"b_sn":1,"b_gt":10,"b_il":180.0},"nl_2":{"b_gf":"%2.","b_ts":{"ts_un":false,"ts_un_i":false,"ts_sc":false,"ts_it_i":true,"ts_fgc2":{"hclr_color":"#000000","clr_type":0},"ts_st_i":true,"ts_bgc2":{"hclr_color":null,"clr_type":0},"ts_fs_i":true,"ts_ff_i":true,"ts_bgc2_i":true,"ts_it":false,"ts_va":"nor","ts_bd_i":true,"ts_va_i":true,"ts_fs":11.0,"ts_ff":"Arial","ts_st":false,"ts_bd":false,"ts_fgc2_i":true,"ts_sc_i":true,"ts_tw":400},"b_ifl":126.0,"b_gs":"","b_a":2,"b_sn":1,"b_gt":15,"b_il":144.0},"nl_1":{"b_gf":"%1.","b_ts":{"ts_un":false,"ts_un_i":false,"ts_sc":false,"ts_it_i":true,"ts_fgc2":{"hclr_color":"#000000","clr_type":0},"ts_
